import React, { useState } from "react";


const App = () => {
  const st = { backgroundColor : "blue"};
  const [bg,setbg] = useState(st)
  const bgChanges = () => {
    const st = { backgroundColor : "violet"};
    setbg(st)
  }
 return (
   <>
   <div style = { bg }>
     <button onClick = {bgChanges} >CLICK ME</button>
   </div>
   </>
 )
}

export default App;
